import React, { useState } from "react";

import SimpleForm from "react-bootstrap/SimpleForm";

import Button from "react-bootstrap/Button";

import "./Login.css";

export default function Login() {

  const [email, setEmail] = useState("");

  const [password, setPassword] = useState("");

  function validateSimpleForm() {

    return email.length > 0 && password.length > 0;

  }

  function handleSubmit(event) {

    event.preventDefault();

  }

  return (

    <div className="Login">

      <SimpleForm onSubmit={handleSubmit}>

        <SimpleForm.Group size="lg" controlId="email">

          <SimpleForm.Label>Email</SimpleForm.Label>

          <SimpleForm.Control

            autoFocus

            type="email"

            value={email}

            onChange={(e) => setEmail(e.target.value)}

          />

        </SimpleForm.Group>

        <SimpleForm.Group size="lg" controlId="password">

          <SimpleForm.Label>Password</SimpleForm.Label>

          <SimpleForm.Control

            type="password"

            value={password}

            onChange={(e) => setPassword(e.target.value)}

          />

        </SimpleForm.Group>

        <Button block size="lg" type="submit" disabled={!validateSimpleForm()}>

          Login

        </Button>

      </SimpleForm>

    </div>

  );

}
